// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/Counters.sol";

contract DiplomaVerifier {
    using Counters for Counters.Counter;
    Counters.Counter private _diplomaIds;

    // Struct để lưu thông tin diploma
    struct Diploma {
        uint256 nameHash;
        uint256 majorCode;
        string studentId;
        string issueDate;
        bool verified;
    }

    // Mapping từ diplomaId đến Diploma
    mapping(uint256 => Diploma) public diplomas;

    // Mapping để kiểm tra diploma đã được verify chưa
    mapping(uint256 => bool) public verifiedDiplomas;

    // Event khi diploma được verify
    event DiplomaVerified(uint256 indexed diplomaId, uint256 nameHash, uint256 majorCode, string studentId, string issueDate);

    // Verification key được tạo từ snarkjs
    uint256 constant vk_alpha1 = 5635002367953871572585346944479831777037889327777474965208652310115052415513;
    uint256 constant vk_beta2 = 13169160798764098323704950457009937617070446790671525540259160225987734135099;
    uint256 constant vk_gamma2 = 10857046999023057135944570762232829481370756359578518086990519993285655852781;
    uint256 constant vk_delta2 = 6586769165972951203253106762249616552403850691358961971090378554646950692153;
    uint256 constant vk_ic_0 = 11666088972002977024343196451236958140900571522128132087341446187687347465539;
    uint256 constant vk_ic_1 = 12775042008031475321332617611627589713071916743346434401909810837112050108538;
    uint256 constant vk_ic_2 = 1;

    // Hàm verify proof
    function verifyProof(
        uint[2] memory a,
        uint[2][2] memory b,
        uint[2] memory c,
        uint[1] memory input
    ) public view returns (bool) {
        // Implement verification logic ở đây
        // Sử dụng verification key để verify proof
        return true; // Tạm thời return true
    }

    // Hàm verify diploma
    function verifyDiploma(
        uint256 diplomaId,
        uint[2] memory a,
        uint[2][2] memory b,
        uint[2] memory c,
        uint[1] memory input
    ) public {
        require(!verifiedDiplomas[diplomaId], "Diploma already verified");
        require(verifyProof(a, b, c, input), "Invalid proof");

        Diploma memory diploma = diplomas[diplomaId];
        verifiedDiplomas[diplomaId] = true;

        emit DiplomaVerified(
            diplomaId,
            diploma.nameHash,
            diploma.majorCode,
            diploma.studentId,
            diploma.issueDate
        );
    }

    // Hàm thêm diploma mới
    function addDiploma(
        uint256 nameHash,
        uint256 majorCode,
        string memory studentId,
        string memory issueDate
    ) public returns (uint256) {
        _diplomaIds.increment();
        uint256 newDiplomaId = _diplomaIds.current();

        diplomas[newDiplomaId] = Diploma({
            nameHash: nameHash,
            majorCode: majorCode,
            studentId: studentId,
            issueDate: issueDate,
            verified: false
        });

        return newDiplomaId;
    }

    // Hàm kiểm tra trạng thái verify của diploma
    function isDiplomaVerified(uint256 diplomaId) public view returns (bool) {
        return verifiedDiplomas[diplomaId];
    }
}

